    newInput.url = getVideoIdFromUrl();
    newInput.rating = 0;
  };
  return (
    <>
    <AddVideo onVidAdd={newVideo}/>
    <div className="container mt-5">
      {sortedVideos.map((video) => (
          <Video videoObj={video} key={video.id} />
